import React from "react";
import Axios from "axios";
import {useFormik} from "formik";
import Image from "./Image";
import { useState } from 'react';
import { Link } from "react-router-dom";
import profile from "../assets/Images/profileImage.png"


const initialValues={
    fullname:'',
    email:'',
    phone:'',
    password:'',
    confirmPassword:'',
}

const validate=values=>{
    const errors={};
    if(!values.fullname){
        errors.fullname="Required";
    }

    if(!values.email){
        errors.email="Required";
    }else if(!/^[A-Z0-9._%+-]+@[A-Z0-9.-]+\.[A-Z]{2,4}$/i.test(values.email)){
        errors.email="Invalid email address";
    }

    if(!values.phone){
        errors.phone="Required";
    }

    if(!values.password){
        errors.password="Required";
    }

    if(!values.confirmPassword){
        errors.confirmPassword="Required";
    }

    return errors;
}

const onSubmit=values=>{
    console.log("form-data",values);
    Axios.post("http://localhost:5050/api/signup",{
        name:values.fullname,
        email:values.email,
        phone:values.phone,
        password:values.password,
        confirmPassword:values.confirmPassword,
        url:values.url
    })

}
function Sign(props){
    const [url,seturl]=useState(' ');
    function imageurl(data){
      seturl(data);
    } 



    const formik=useFormik({
        initialValues,
        validate,
        onSubmit,
     })
     formik.values.url=url;
    //  console.log("value_url",formik.values.url);
    // console.log("url in sign ",props.url);
   
    return(
     <div>
         <img className=" mx-auto" style={{width:200}} src={url} alt=""/>
          
         <Image imageurl={imageurl}/> 


         <div class="mx-auto max-w-screen-xl px-4 py-16 sm:px-6 lg:px-8">
         <div class="mx-auto max-w-lg">

         <h1 class="text-center text-2xl font-bold text-indigo-600 sm:text-3xl">
                             Get started today
         </h1>

         <form onSubmit={formik.handleSubmit} className="mb-0 mt-6 space-y-4 rounded-lg p-4 shadow-lg sm:p-6 lg:p-8">
         <p class="text-center text-lg font-medium">Sign in to your account</p>



{/* ******************************* */}
<div>
<label for="email" class="sr-only">Email</label>
<div class="relative">
          <input
            type="text" 
            id="fullname" 
            name="fullname"
            onChange={formik.handleChange}
            value={formik.values.fullname}
            onBlur={formik.handleBlur}
            class="w-full rounded-lg border-gray-200 p-4 pe-12 text-sm shadow-sm"
            placeholder="Enter email"
          />

         <span class="absolute inset-y-0 end-0 grid place-content-center px-4">
            <svg
              xmlns="http://www.w3.org/2000/svg"
              class="h-4 w-4 text-gray-400"
              fill="none"
              viewBox="0 0 24 24"
              stroke="currentColor"
            >
              <path
                stroke-linecap="round"
                stroke-linejoin="round"
                stroke-width="2"
                d="M16 12a4 4 0 10-8 0 4 4 0 008 0zm0 0v1.5a2.5 2.5 0 005 0V12a9 9 0 10-9 9m4.5-1.206a8.959 8.959 0 01-4.5 1.207"
              />
            </svg>
          </span>
          {formik.touched.fullname && formik.errors.fullname ? (<div>{formik.errors.fullname}</div>):null}
        </div>
      </div>
{/* ************************ */}

             

             <div className="flex flex-col items-center">
             <label className=" mb-1 uppercase font-bold text-lg text-grey-darkest" htmlFor="fullname">FullName</label>
             <input 
             type="text" 
             id="fullname" 
             name="fullname"
             onChange={formik.handleChange}
             value={formik.values.fullname}
             onBlur={formik.handleBlur}
             className="border py-1 px-3 text-grey-darkest border-black max-w-xl mx-auto"
             />
             {formik.touched.fullname && formik.errors.fullname ? (<div>{formik.errors.fullname}</div>):null}
            </div>

            <div className="flex flex-col ">
             <label className=" mb-1 uppercase font-bold text-lg text-grey-darkest" htmlFor="email">E-mail</label>
             <input 
             type="text" 
             id="email" 
             name="email"
             onChange={formik.handleChange}
             value={formik.values.email}
             onBlur={formik.handleBlur}
             className="border py-1 px-3 text-grey-darkest border-black max-w-xl mx-auto"
             />
              {formik.touched.email && formik.errors.email ? (<div>{formik.errors.email}</div>):null}
            </div>

            <div className="flex flex-col ">
             <label className=" mb-1 uppercase font-bold text-lg text-grey-darkest" htmlFor="phone">Phone No.</label>
             <input 
             type="text" 
             id="phone" 
             name="phone"
             onChange={formik.handleChange}
             value={formik.values.phone}
             onBlur={formik.handleBlur}
             className="border py-1 px-3 text-grey-darkest border-black max-w-xl mx-auto"
             />
              {formik.touched.phone && formik.errors.phone ? (<div>{formik.errors.phone}</div>):null}
            </div>

            <div className="flex flex-col ">
             <label className=" mb-1 uppercase font-bold text-lg text-grey-darkest" htmlFor="password">Password</label>
             <input 
             type="text" 
             id="password" 
             name="password"
             onChange={formik.handleChange}
             value={formik.values.password}
             onBlur={formik.handleBlur}
             className="border py-1 px-3 text-grey-darkest border-black max-w-xl mx-auto"
             />
             {formik.touched.password && formik.errors.password ? (<div>{formik.errors.password}</div>):null}
             
             </div>

             <div className="flex flex-col ">
             <label className=" mb-1 uppercase font-bold text-lg text-grey-darkest" htmlFor="confirmPassword">Confirm Password</label>
             <input 
             type="text" 
             id="confirmPassword" 
             name="confirmPassword"
             onChange={formik.handleChange}
             value={formik.values.confirmPassword}
             onBlur={formik.handleBlur}
             className="border py-1 px-3 text-grey-darkest border-black  max-w-2xl mx-auto"
             />
             {formik.touched.confirmPassword && formik.errors.confirmPassword ? (<div>{formik.errors.confirmPassword}</div>):null}

             </div>

             <button className="border border-blue-950 rounded-md  shadow-lg bg-blue-600 text-white text-semibold px-4 my-3 py-2"  type="submit">Sign Up</button>
         </form>
           
            
            
            

            <Link to={"/login"}>
                <button>Login</button>
            </Link>
            
         </div>

         </div>
         </div>

      
        
    )
 }
 
 export default Sign;
